$_MODULE['<{abandonedcart}prestashop>abandonedcart_b14c240dbed0f1210b2ac554936e6e0e'] = "Zdajemy sobie sprawę, że może być niewygodne z konfiguracją CRON więc ten moduł posiada opcję aktualizacji listy porzucony koszyk i wysyłać e-maile z przypomnieniem ręcznie. Ale zalecamy wszystkim używać CRON jak w przypadku dużej ilości porzuconych wozów, to nie jest możliwe, aby wysłać e-mail do administratora ręcznie.";
